import pandas as pd
from utils import get_data_dir_shhs
from pathlib import Path

# Function to print age and sex of nsrrids
def nsrrid_age_sex(nsrrids: list = None):
    ages = []
    sexes = []

    datadir = Path(get_data_dir_shhs(data_type="t", art_rejection=True, filtering=True, prec_epochs=2, foll_epochs=1)).parent.parent.parent.parent
    df = pd.read_csv(datadir / "Raw/shhs/datasets/shhs-harmonized-dataset-0.20.0.csv")
    for nsrrid in nsrrids:
        _ = df.loc[df['nsrrid'] == nsrrid, ['nsrr_age', 'nsrr_sex']]
        age = int(_['nsrr_age'].iloc[0])
        sex = _['nsrr_sex'].iloc[0]
        ages.append(age)
        sexes.append(sex)
    result = pd.DataFrame({"nsrrid": nsrrids, "age": ages, "sex": sexes})
    result = result.sort_values("age") # sort by age
    print(result.to_string())


